import React from 'react'
import { useSelector, useDispatch } from 'react-redux'

import {
    updateName,
    getSelectedEventMeta,
    getSelectedFields,
    getProcessedRecordsCount,
    getPersistanceTimeRecord,
} from '../../../actions/dataActions'

export default function Summary() {
    const computedEvents = useSelector((state) => state.dataReducer.computedEvents)
    const selectedTenant = useSelector((state) => state.dataReducer.selectedTenant)
    const selectedEvent = useSelector((state) => state.dataReducer.selectedEvent)
    const highlightedEvent = useSelector((state) => state.dataReducer.highlightedEvent)

    const dispatch = useDispatch()
    const handleOnClick = (e) => {


        dispatch(updateName(e))
        dispatch(getProcessedRecordsCount(selectedTenant, e))
        dispatch(getPersistanceTimeRecord(selectedTenant, e,7))

        dispatch(getSelectedEventMeta(selectedTenant, e))
        dispatch(getSelectedFields(selectedTenant, e))
    }


    const giveClassNames = (name) => {
        if (name === selectedEvent) {
            if (name === highlightedEvent) {
                return ("highlighted active")
            }
            else {
                return ("active")
            }

        }
        else {
            return ("inactive")
        }
    }
    // console.log(computedEvents,'num')


    return (
        <>
            {
                computedEvents.map((item) => {
                    const classNames = giveClassNames(item.name)
                    return (
                        <div className="line" onClick={() => handleOnClick(item.name)}>
                            <div className="dot"></div>
                            <p className={classNames}>{item.name}</p>
                        </div>
                    )
                }
                )
            }
        </>

    )
}
